function Main(props) {

    return (
        <div>
            <Header />
            <MainEventCarousel/>
            <MainCardCarousel title={'베스트도서'} />
            <MainCardCarousel title={'새로 등록된 도서'} />
            <MainCardCarousel title={'추천 도서'} />
            <Footer />
        </div>
    );
}

export default Main;
